import React, { Component } from 'react';

class Parent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      parentMessage: 'Dad',
    };
  }

  greetParent = () => {
    alert(`Hello ${this.state.parentMessage}`);
  };

  render() {
    return <div></div>;
  }
}

export default Parent;
